import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const WelcomeBox = () => {
    const boxStyle = {
        backgroundColor: '#8B4513',
        color: '#ffffff',
        padding: '20px',
        borderRadius: '10px',
        textAlign: 'center',
    };

    return (
        <div style={boxStyle}>
            Bienvenido
        </div>
    );
};

ReactDOM.render(
    <React.StrictMode>
        <App />
        <WelcomeBox />
    </React.StrictMode>,
    document.getElementById('root')
);
